import { Bottle } from "./Bottle"
import { BottlesList } from "./BottlesList";

export const Home = () => {

    const bottleFlex = [];
    for(let i=0;i < 6;i++) {
        bottleFlex[i] = <Bottle/>;
    }
    return (
        <>
            <h1>Products</h1>
            <Bottle/>
            <div>{bottleFlex}</div>
            <BottlesList/>
        </>
    )
}
